import { Routes } from '@angular/router';

export const APP_ROUTES: Routes = [
  {
    path: 'welcome',
    loadChildren: () => import('./welcome/').then(m => m.w),
  },
  {
    path: '',
    redirectTo: 'home',
    pathMatch: 'full',
  },
];
